== 说明 ==
用来生成交叉颜色的模板。
== 使用方法 ==
<nowiki>{{Crossover|c1=顏色|欲|顯|示|文|字}}</nowiki> 

<nowiki>{{Crossover|c1=顏色|c2=颜色|欲|顯|示|文|字}}</nowiki> 

<nowiki>{{Crossover|c1=顏色|c2=颜色|c3=颜色|欲|顯|示|文|字}}</nowiki> 

<nowiki>{{Crossover|c1=顏色|c2=颜色|c3=颜色|c4=颜色|欲|顯|示|文|字}}</nowiki> 

